export default function Result(props) {
  if (props.result) {
    return (
      <div className="Result">
        <h2>{props.result.word}</h2>
        {props.result.meanings.map(function (meaning, index) {
          return meaning.definittion;
        })}
      </div>
    );
  } else {
    return null;
  }
}
